Ashok is unable to find employment and is in desperate need of money to cure his blind sister, Roopa. He then finds employment with wealthy Sarojini Devi who asks him to subdue her out-of-control grand-daughters, Asha, Manju and Anju. He sets about to do so with considerable success but in the process falls in love with Asha. This does not auger well with Sarojini, who fires him, and sets about to get Asha married to London-based Pran. Ashok returns home and finds Roopa missing. Shortly thereafter he finds evidence that she may have killed herself. The only clue he has is a license plate number - and he sets about to trace it - not knowing that the person/s he is looking for is already aware of this agenda - and has/have set up an elaborate web of deceit to entrap him.

